<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <script

    <title>Document</title>
    <style>
       @import url('https://fonts.googleapis.com/css2?family=Poppins:wght@200&display=swap');
       label{
           display: none;
       }
       *{
           margin: 0;
           padding: 0;
           box-sizing: border-box;
           font-family: 'Poppins', sans-serif;
       }
       section{
           position: relative;
           width: 100%;
           height: 100vh;
           display: flex;
       }
       section .leftbox{
           position: relative;
           width: 50%;
           height: 100%;
       }
       section .leftbox:before{
           content: '';
           position: absolute;
           top: 0;
           left: 0;
           width: 100%;
           height: 100%;
           border-radius: 0 0 10% 0;
           background: linear-gradient(225deg, #042e3f, #064a5f);
           z-index: 1; 
       }
       section .leftbox svg{
           position: absolute;
           top: 0;
           left: 0;
           width: 100%;
           scale: 5;
           height: 100%;
           object-fit: cover;
       }
       section .contentbox{
           display: flex;
           flex-direction: column;
           justify-content: center;
           align-items: center;
           width: 50%;
           height: 100%;
       }
       section .contentbox h1{
           color: #607d8b;
           margin-left: 12px;
           font-weight: 600;
           font-size: 1.5em;
           text-transform: uppercase;
           margin-bottom: 20px;
           border-bottom: 4px solid #064a5f;
           display: inline-block;
           letter-spacing: 2px;
       }
       section .contentbox .para{
           margin-left: 1.3rem;
       }
       section .contentbox input{
           background: #f4ecec;
           box-shadow: inset 2px 2px 5px #a19c9c,
                       inset -2px -2px 5px #ffffff;
           margin-bottom: 20px;
           width: 110%;
           height: 6vh;
           padding: 10px 20px;
           outline: none;
           font-weight: 400;
           border: none;
           font-size: 16px;
           letter-spacing: 2px;
           color: #607d8b;
           background: transparent;
           border-radius: 55px;
       }
       section .contentbox .btn{
           margin-bottom: 10px;
           cursor: pointer;
           width: 50%;
           height: 5vh;
           outline: none;
           font-weight: 600;
           margin-left:3.8rem;
           border: none;
           font-size: 16px;
           letter-spacing: 2px;
           color: #ffffff;
           background: linear-gradient(145deg, #064a5f, #187b99);
            box-shadow:  2px 3px 0px #b6a5a5,
                        -2px -4px 0px #ffffff;
           border-radius: 55px;
       }
       section .contentbox .btn:hover{
           background: #042e3f;
       }    
    </style>
    
</head>
